CLANG_VERSION:
- 17.0.6
CL_VERSION:
- 19.42.34433
FINAL_CFLAGS:
- -march=nocona -mtune=haswell -ftree-vectorize -fstack-protector-strong -O2 -ffunction-sections
  -pipe
FINAL_CL_FLAGS:
- /Oi /O2 /GS /Gy /MD /std:c++17 -march=nocona -mtune=haswell -fuse-ld=lld -fno-aligned-allocation
FINAL_CXXFLAGS:
- -fvisibility-inlines-hidden -std=c++17 -fmessage-length=0 -march=nocona -mtune=haswell
  -ftree-vectorize -fstack-protector-strong -O2 -ffunction-sections -pipe
RUNTIME_VERSION:
- 14.42.34433
VCVER:
- '14.3'
VSYEAR:
- '2022'
channel_sources:
- conda-forge
channel_targets:
- conda-forge main
target_platform:
- win-64
zip_keys:
- - VCVER
  - VSYEAR
  - RUNTIME_VERSION
  - CL_VERSION
